import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import Button from "@material-ui/core/Button";
import { Avatar, Paper } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  appBar: {
    backgroundColor: "rgba(225, 225, 225, .5)",
    boxShadow: "none",
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
    marginLeft: "10px",
    color: "black",
  },
}));

function WireFrame() {
  const classes = useStyles();
  return (
    <>
      <Paper
        style={{
          height: "100%",
          backgroundPosition: "center",
          backgroundRepeat: "no-repeat",
          backgroundSize: "cover",
          backgroundImage: `url("/assets/bg-1.jpg")`,
        }}
      >
        <AppBar className={classes.appBar} position="static">
          <Toolbar>
            <Avatar variant="rounded" alt="Ic" src="/assets/logo.png" />
            <Typography className={classes.title}>iConnect</Typography>
            <Button>About</Button>
            <Button>FAQ</Button>
            <Button>Features</Button>
            <Button>Journey</Button>
            <Button variant="contained" color="primary">
              Am i eligible?
            </Button>
          </Toolbar>
        </AppBar>
        <div>
          <h1>
            A Clinical Research Study For People With myelodysplastic Syndromes
            With Anemia
          </h1>
        </div>
      </Paper>

      {/* <AppBar className={classes.appBar} position="static">
        <Toolbar>
          <Avatar variant="rounded" alt="Ic" src="/assets/logo.png" />
          <Typography className={classes.title}>iConnect</Typography>
          <Button>About</Button>
          <Button>FAQ</Button>
          <Button>Features</Button>
          <Button>Journey</Button>
          <Button variant="contained" color="primary">
            Am i eligible?
          </Button>
        </Toolbar>
      </AppBar> */}
    </>
  );
}

export default WireFrame;
